import PropTypes from 'prop-types';
import Link from 'next/link';


const AppLayout = ({children}) => {
  return(
      <div>
        <div>공통메뉴</div>
        {children}
      </div>
  )
}

AppLayout.propTypes = {
  children: PropTypes.node.isRequired, // node : nodejs의 노드가 아니고 return에 들어가는 모든 것들을 의미한다.
}

export default AppLayout;
